export function SubjecIcon(props: {
  name: string;
  isSenior?: boolean;
  isWhite?: boolean;
}) {
  return (
    <>
      {(props.isSenior
        ? props.name in iconsPathS
        : props.name in iconsPath) && (
        <svg
          style={{ padding: "5px" }}
          width="50"
          height="50"
          viewBox={"0 0 65 64"}
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
        >
          {props.isSenior
            ? iconsPathS[props.name].map((x) => {
                return <path d={x} fill={props.isWhite ? "white" : "black"} key={x}/>;
              })
            : iconsPath[props.name].map((x) => {
                return <path d={x} fill={props.isWhite ? "white" : "black"} key={x}/>;
              })}
        </svg>
      )}
    </>
  );
}
